import React from 'react';

const CurrentTemp = ({temp}) => {
	return (
		<div>
			<h3>
				Current Temp:
			</h3>
			<h5>
				The temperature in 'city' is {temp}.
			</h5>
		</div>
	);
}

export default CurrentTemp;
